import styled from "styled-components";

export const Container = styled.div`
  flex: 1;
  height: ${window.innerHeight}px;
  position: relative;
  background: blue;
`;

export const Painel = styled.div`
  height: 130px;
  width: 100%;
  background: #fff;
  background: red;
`;
